        if (viewerModifiers) {
            var items = viewerModifiers.split('&');
            for (var i = 0; i < items.length; i++) {
                //only when there is key=val pair
                if (items[i].indexOf('=') > 0) {
                    var key = items[i].substring(0, items[i].indexOf('='));
                    var val = items[i].substring(items[i].indexOf('=') + 1);
                    modifiers[key] = val;
                }
            }
        }
        return modifiers;
