            stageSize = component.data('stagesize');

        if (typeof viewer != 'undefined' && viewer != null) {
            viewer.dispose();
            S7dmUtils[compId] = null;
            component.removeClass(responsiveViewerCSS);
        }
        component.html('');
        var viewerType = component.data('viewer-type');

